    false,nt"url": null,nt"notes": "This report summarizes a follow-up inventory
    of Odonata (damselflies, suborder Zygoptera, and dragonflies, suborder Anisoptera)
    at the Detroit River International Wildlife Refuge, Humbug Marsh Unit, Trenton and
    Gibraltar, Wayne County, MI (hereafter referred to as u201cHumbug@) as recommended
    in Craves (2007). The 2008 surveys emphasized recording Odonata species with early
    flight seasons, as well as those species that may have been under-represented in
    2007 due to hot, dry weather that year. Another objective of these surveys was to
    compile a list of the Lepidoptera present at Humbug, and to try to determine the
    importance of Humbug as a migratory stopover for Monarchs(Danaus plexippus) by participating
    in the Monarch tagging project adminstered by the Kansas Biological Survey.",nt"license_title":
